import React, { useState, useEffect, useRef } from 'react';
import { View, Text, Button, Image, TouchableOpacity, StyleSheet } from 'react-native';
import { Camera } from 'expo-camera';
import AsyncStorage from '@react-native-async-storage/async-storage';
import DraggableFlatList from 'react-native-draggable-flatlist';

const Receipt = () => {
  const [selectedFolder, setSelectedFolder] = useState('All');
  const [images, setImages] = useState([]);
  const cameraRef = useRef(null);
  const [hasPermission, setHasPermission] = useState(null);
  const [cameraType, setCameraType] = useState(Camera.Constants.Type.back);

  useEffect(() => {
    getImages();
    getCameraPermission();
  }, []);

  const getImages = async () => {
    try {
      const storedImages = await AsyncStorage.getItem(selectedFolder);
      if (storedImages) {
        setImages(JSON.parse(storedImages));
      }
    } catch (error) {
      console.error(error);
    }
  };

  const saveImage = async (uri) => {
    try {
      const storedImages = await AsyncStorage.getItem(selectedFolder);
      if (storedImages) {
        const updatedImages = [...JSON.parse(storedImages), uri];
        await AsyncStorage.setItem(selectedFolder, JSON.stringify(updatedImages));
      } else {
        await AsyncStorage.setItem(selectedFolder, JSON.stringify([uri]));
      }
      setImages([...images, uri]);
    } catch (error) {
      console.error(error);
    }
  };

  const getCameraPermission = async () => {
    const { status } = await Camera.requestPermissionsAsync();
    setHasPermission(status === 'granted');
  };

  const takePicture = async () => {
    if (cameraRef.current) {
      const photo = await cameraRef.current.takePictureAsync();
      saveImage(photo.uri);
    }
  };

  const renderImages = () => {
    if (images.length === 0) {
      return <Text>No images found</Text>;
    }

    return (
      <DraggableFlatList
        data={images}
        renderItem={({ item }) => (
          <View style={styles.imageContainer}>
            <Image source={{ uri: item }} style={styles.image} />
          </View>
        )}
        keyExtractor={(item) => item}
        onDragEnd={({ data }) => setImages(data)}
      />
    );
  };

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Image Gallery</Text>

      <View style={styles.buttonContainer}>
        <TouchableOpacity
          style={styles.button}
          onPress={() => setSelectedFolder('All')}
        >
          <Text style={styles.buttonText}>All</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => setSelectedFolder('Groceries')}
        >
          <Text style={styles.buttonText}>Groceries</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => setSelectedFolder('Luxuries')}
        >
          <Text style={styles.buttonText}>Luxuries</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => setSelectedFolder('Bills')}
        >
          <Text style={styles.buttonText}>Bills</Text>
        </TouchableOpacity>
        <TouchableOpacity
          style={styles.button}
          onPress={() => setSelectedFolder('Expenses')}
        >
          <Text style={styles.buttonText}>Expenses</Text>
        </TouchableOpacity>
      </View>

      {hasPermission ? (
        <Camera style={styles.camera} type={cameraType} ref={cameraRef} />
      ) : (
        <Text>No access to camera</Text>
      )}

      <Button title="Take Picture" onPress={takePicture} disabled={!hasPermission} />

      <View style={styles.imageList}>{renderImages()}</View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 16,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  },
  buttonContainer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    marginBottom: 16,
  },
  button: {
    paddingHorizontal: 16,
    paddingVertical: 8,
    borderRadius: 16,
  },
  buttonText: {
    color: 'white',
    fontWeight: 'bold',
  },
  camera: {
    width: '100%',
    aspectRatio: 1,
    marginBottom: 16,
  },
  imageList: {
    flex: 1,
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  imageContainer: {
    width: '50%',
    padding: 8,
  },
  image: {
    width: '100%',
    aspectRatio: 1,
    borderRadius: 8,
  },
});

export default Receipt;
